import { useState } from 'react';
import TextInput from './../TextInput/TextInput';
import styles from './PeopleInput.module.scss'

const PeopleInput = () => {
  const [peopleMax, setPeopleMax] = useState('');
  const [peopleSitting, setPeopleSitting] = useState('');
  const [status] = useState('');


  if (status.value === "Cleaning" || status.value === "Free")
    return (
      <div>
        <label className={styles.paramtitle}>People:</label> <TextInput value="0" onChange={e => setPeopleSitting(e.target.value)} />
        <span>/</span>
        <TextInput value="0" onChange={e => setPeopleMax(e.target.value)} />
      </div>
    )
  else
    return (
      <div>
        <label className={styles.paramtitle}>People:</label> <TextInput value={peopleSitting} onChange={e => setPeopleSitting(e.target.value)} />
        <span>/</span>
        <TextInput value={peopleMax} onChange={e => setPeopleMax(e.target.value)} />
      </div>

    )
}

export default PeopleInput;
